import React from 'react';

function Pic() {
  return (
    <>
      <h2>Pic</h2>
      <img src="https://images.app.goo.gl/ABhM1e44KW2bP67E6" alt="Pic 1"/>
        <img src="https://images.app.goo.gl/28Ed9BVJ5VU2xqUf7" alt="Pic2"/>
        <img src="https://images.app.goo.gl/kYQJ488NrtmKZSX1A" alt="Pic3"/>
        <img src="https://images.app.goo.gl/gVpcZvWb1c7D43eL7" alt="Sketch4"/>
        <img src="https://images.app.goo.gl/3qnkKL246vLm7BVv6" alt="Sketch5"/>
        <img src="https://images.app.goo.gl/cqES2iNQohmKiZcZ9"alt="Sketch6"/>

      <button id="like-btn"onclick="toggleLike()">Like</button> 
      <span id="like-count"></span>
    </>
  );
}

export default Pic;
